As a climber flying and driving around the planet, I'm very aware of my huge CO2 footprint. It has been an issue I have been thinking about more and more over the past years. Reducing my flying has been an important step for me, but I wanted to do more. 
Offsetting my carbon footprint was something I looked into and I finally found a great company to help me do so.
@zeroco2.earth is planting trees to help companies and individuals to offset their carbon footprint. They do it sustainably, taking ecosystems and social structures into account. They work together with local communities to ensure that trees get taken care of and get planted in the right spots. 
I want to encourage you to think about looking into this. You can also "buy" trees and watch them grow online or give them to somebody as a present! 
You'll find the link to their website in my bio if you want to know more. 
I know offsetting my carbon footprint is not the solution to my CO2 emissions, but it's a start. 

